(3, 18, 11, 1, '', 'El cliente, originario de Monterrey, México, solicita una visa H-1B especializada en ocupaciones que requieren habilidades altamente especializadas. Tiene una oferta de trabajo de una empresa de tecnología en Dallas, Texas, para ocupar el puesto de ingeniero de software, posición que requiere su formación específica en ingeniería de sistemas y su experiencia de 5 años en el desarrollo de software empresarial. Ha completado todos los requisitos previos y ha presentado la documentación correspondiente, incluyendo títulos, certificaciones y cartas de recomendación. La empresa patrocinadora ha confirmado su intención de emplearlo y ha presentado el formulario I-129. Los antecedentes del cliente están limpios, y ha viajado a Estados Unidos anteriormente sin incidentes, siempre respetando los términos de su visa. Se busca asesoría para asegurar el cumplimiento de todas las regulaciones pertinentes y para facilitar el proceso de aprobación de su visa.\r\n', '820.00', '2023-11-10 01:39:24', '2023-11-10 01:39:24', 1, 0, NULL, NULL, 0, 1),
