(38, 54, 53, 66, 'I-90 Greencard Renewal/Replacement', 'Caso: I-90 Renovación/Reemplazo de la Tarjeta Verde\r\n\r\nDescripción:\r\n\r\nEl solicitante, [Nombre del Cliente], presenta una solicitud para la renovación/reemplazo de su Tarjeta Verde (Green Card) utilizando el Formulario I-90. La tarjeta actual está próxima a su fecha de vencimiento y/o ha sido extraviada o dañada, lo que requiere su reemplazo.\r\n\r\nDetalles del Caso:\r\n\r\nMotivo de la Solicitud: Renovación/Reemplazo de la Tarjeta Verde.\r\nFecha de Última Emisión: [Fecha de emisión de la tarjeta actual].\r\nRazón del Reemplazo: [Vencimiento próximo, pérdida, daño, o cambio de nombre].\r\nDocumentación Adicional: Se han adjuntado copias de los documentos que respaldan la solicitud, incluyendo la copia de la Tarjeta Verde actual, prueba de identidad, y cualquier otra documentación pertinente como la declaración de pérdida o informe policial (en caso de pérdida).\r\nComentarios Adicionales: El cliente ha sido informado sobre el tiempo de procesamiento estimado y los pasos a seguir durante el proceso. Se le ha recomendado mantener una copia de la tarjeta actual hasta que reciba la nueva.\r\nEstatus Actual: La solicitud ha sido presentada a USCIS y se encuentra en proceso de revisión. Se está a la espera de la confirmación de recepción y del número de caso.\r\n\r\nPróximos Pasos:\r\n\r\nMonitorizar la recepción del aviso de acción de USCIS.\r\nProgramar una cita para la toma de huellas dactilares y otros datos biométricos, si es necesario.\r\nMantener contacto regular con el cliente para informar sobre cualquier actualización.', '0.00', '2024-08-02 12:45:33', '2024-08-02 12:52:53', 4, 30706, '[{\"id\": \"195\", \"label\": \"CONSULTA / FREE\"}]', '2024-08-02', 1, 1),
(39, 54, 53, 195, 'CONSULTA / FREE', '<h3>Resumen:</h3>\r\n<ul>\r\n<li><strong>Reinicializaci&oacute;n de TinyMCE</strong>: Se destruye y reinicializa TinyMCE al expandir una fila, asegurando que siempre funcione cuando la fila se vuelve a abrir.</li>\r\n<li><strong>Destrucci&oacute;n previa al colapsar</strong>: TinyMCE se destruye antes de colapsar la fila, evitando instancias obsoletas que podr&iacute;an interferir con la nueva inicializaci&oacute;n.</li>\r\n</ul>\r\n<p>Esto deber&iacute;a resolver el problema de TinyMCE desapareciendo cuando colapsas y expandes una fila en la tabla.</p>', '0.00', '2024-08-02 13:26:35', '2024-08-02 20:13:43', 4, 0, '[]', '2024-08-31', 1, 2),
(40, 54, 53, 85, 'N- 400 Naturalization', '<p><strong>Cliente:</strong> John Doe</p>\r\n<p><strong>Fecha de Ingreso a los EE. UU.:</strong> 15 de marzo de 2010</p>\r\n<p><strong>Residencia Permanente:</strong> John Doe ha sido residente permanente legal desde el 10 de septiembre de 2012. Ha cumplido con el requisito de residencia continua, habiendo vivido en los EE. UU. durante m&aacute;s de 5 a&ntilde;os consecutivos.</p>\r\n<p><strong>Residencia y Presencia F&iacute;sica:</strong> Durante los &uacute;ltimos 5 a&ntilde;os, el cliente ha estado fuera de los EE. UU. en cuatro ocasiones, con un total de 120 d&iacute;as acumulados fuera del pa&iacute;s. Ninguna de estas ausencias ha excedido los 6 meses. John ha residido continuamente en los EE. UU. en la direcci&oacute;n 1234 Main Street, Los &Aacute;ngeles, CA.</p>\r\n<p><strong>Ocupaci&oacute;n:</strong> John trabaja como ingeniero de software en Tech Solutions LLC desde 2013, lo que cumple con los requisitos de empleo continuo.</p>\r\n<p><strong>Conocimiento del Idioma Ingl&eacute;s y Educaci&oacute;n C&iacute;vica:</strong> John ha completado un curso de ingl&eacute;s avanzado y ha aprobado un examen de educaci&oacute;n c&iacute;vica en preparaci&oacute;n para la entrevista de naturalizaci&oacute;n.</p>\r\n<p><strong>Historial Penal:</strong> John tiene un historial penal limpio. No ha sido arrestado ni acusado de ning&uacute;n delito. Tambi&eacute;n ha cumplido con todas sus obligaciones fiscales.</p>\r\n<p><strong>Motivo de la Naturalizaci&oacute;n:</strong> John desea convertirse en ciudadano estadounidense para poder participar plenamente en la vida c&iacute;vica de su comunidad, incluyendo el derecho al voto y la posibilidad de solicitar la ciudadan&iacute;a para sus hijos menores.</p>\r\n<p><strong>Documentos Presentados:</strong> La solicitud N-400 ha sido presentada con los siguientes documentos adjuntos: copia de la \"Green Card\", declaraci&oacute;n de impuestos de los &uacute;ltimos 5 a&ntilde;os, certificado de finalizaci&oacute;n del curso de ingl&eacute;s, y carta de empleo actualizada.</p>\r\n<p><strong>Pr&oacute;ximos Pasos:</strong> A la espera de la notificaci&oacute;n para la entrevista de naturalizaci&oacute;n. El cliente ha sido instruido para mantenerse disponible y notificar cualquier cambio en su situaci&oacute;n migratoria o personal. Adem&aacute;s, se le ha aconsejado evitar viajes prolongados fuera de los EE. UU. hasta que se complete el proceso.</p>', '1000.00', '2024-08-02 20:36:12', '2024-08-02 20:44:32', 4, 0, '[{\"id\": \"167\", \"label\": \"Consultation / Cita\"}, {\"id\": \"176\", \"label\": \"CONSULTA / PROMO\"}, {\"id\": \"195\", \"label\": \"CONSULTA / FREE\"}]', '2024-08-03', 0, 1),
(41, 54, 53, 189, 'I-134 Declaration of Financial Support', '<p><strong>Cliente:</strong> John Doe</p>\r\n<p><strong>Fecha de Ingreso a los EE. UU.:</strong> 15 de marzo de 2010</p>\r\n<p><strong>Residencia Permanente:</strong> John Doe ha sido residente permanente legal desde el 10 de septiembre de 2012. Ha cumplido con el requisito de residencia continua, habiendo vivido en los EE. UU. durante m&aacute;s de 5 a&ntilde;os consecutivos.</p>\r\n<p><strong>Residencia y Presencia F&iacute;sica:</strong> Durante los &uacute;ltimos 5 a&ntilde;os, el cliente ha estado fuera de los EE. UU. en cuatro ocasiones, con un total de 120 d&iacute;as acumulados fuera del pa&iacute;s. Ninguna de estas ausencias ha excedido los 6 meses. John ha residido continuamente en los EE. UU. en la direcci&oacute;n 1234 Main Street, Los &Aacute;ngeles, CA.</p>\r\n<p><strong>Ocupaci&oacute;n:</strong> John trabaja como ingeniero de software en Tech Solutions LLC desde 2013, lo que cumple con los requisitos de empleo continuo.</p>\r\n<p><strong>Conocimiento del Idioma Ingl&eacute;s y Educaci&oacute;n C&iacute;vica:</strong> John ha completado un curso de ingl&eacute;s avanzado y ha aprobado un examen de educaci&oacute;n c&iacute;vica en preparaci&oacute;n para la entrevista de naturalizaci&oacute;n.</p>\r\n<p><strong>Historial Penal:</strong> John tiene un historial penal limpio. No ha sido arrestado ni acusado de ning&uacute;n delito. Tambi&eacute;n ha cumplido con todas sus obligaciones fiscales.</p>\r\n<p><strong>Motivo de la Naturalizaci&oacute;n:</strong> John desea convertirse en ciudadano estadounidense para poder participar plenamente en la vida c&iacute;vica de su comunidad, incluyendo el derecho al voto y la posibilidad de solicitar la ciudadan&iacute;a para sus hijos menores.</p>\r\n<p><strong>Documentos Presentados:</strong> La solicitud N-400 ha sido presentada con los siguientes documentos adjuntos: copia de la \"Green Card\", declaraci&oacute;n de impuestos de los &uacute;ltimos 5 a&ntilde;os, certificado de finalizaci&oacute;n del curso de ingl&eacute;s, y carta de empleo actualizada.</p>\r\n<p><strong>Pr&oacute;ximos Pasos:</strong> A la espera de la notificaci&oacute;n para la entrevista de naturalizaci&oacute;n. El cliente ha sido instruido para mantenerse disponible y notificar cualquier cambio en su situaci&oacute;n migratoria o personal. Adem&aacute;s, se le ha aconsejado evitar viajes prolongados fuera de los EE. UU. hasta que se complete el proceso.</p>', '2500.00', '2024-08-02 20:46:31', '2024-08-02 20:58:28', 4, 0, '[{\"id\": \"193\", \"label\": \"Humanitarian Reinstatement\"}, {\"id\": \"120\", \"label\": \"I-601\"}, {\"id\": \"180\", \"label\": \"Parole in Place\"}, {\"id\": \"146\", \"label\": \"TPS\"}, {\"id\": \"127\", \"label\": \"Motion to Change Venue\"}]', '2024-08-30', 0, 1),
(42, 54, 53, 96, 'FOIA', '<p>El cliente solicit&oacute; una copia completa de su expediente de inmigraci&oacute;n bajo la Ley de Libertad de Informaci&oacute;n (FOIA) para verificar la informaci&oacute;n en su archivo antes de proceder con un caso de ajuste de estatus. La solicitud incluye todos los documentos presentados, las decisiones emitidas, y cualquier correspondencia entre el cliente y el Servicio de Ciudadan&iacute;a e Inmigraci&oacute;n de EE.UU. (USCIS). El cliente expres&oacute; preocupaci&oacute;n por posibles discrepancias en las fechas de entrada y salida registradas en su archivo, lo que podr&iacute;a afectar su elegibilidad para la regularizaci&oacute;n de estatus.</p>\r\n<p>La solicitud fue presentada el 15 de junio de 2024. Hasta la fecha, se ha recibido una confirmaci&oacute;n de recepci&oacute;n por parte de USCIS, pero no se ha recibido la documentaci&oacute;n completa. Se ha iniciado seguimiento con la agencia para acelerar la respuesta debido a la naturaleza urgente del caso.</p>\r\n<p>El cliente tambi&eacute;n ha sido informado sobre los posibles tiempos de espera asociados con las solicitudes FOIA y se ha discutido la opci&oacute;n de proceder con un recurso en caso de demora significativa en la entrega de los documentos solicitados. Adem&aacute;s, se le ha recomendado no tomar ninguna decisi&oacute;n legal hasta que se obtenga y revise el expediente completo.</p>', '500.00', '2024-08-02 21:16:56', '2024-08-02 23:01:10', 4, 30708, '[{\"id\": \"167\", \"label\": \"Consultation / Cita\"}, {\"id\": \"176\", \"label\": \"CONSULTA / PROMO\"}, {\"id\": \"195\", \"label\": \"CONSULTA / FREE\"}, {\"id\": \"96\", \"label\": \"FOIA\"}]', '2024-08-25', 0, 1),
(43, 59, 50, 167, 'Consultation / Cita', 'Cliente vino a la oficina, tuvoi dos capturas en el ano 2013 se le dio de cortesia un CBP FOIA regular para tarter de ver la information que no aparece en el obvio foia tomado en otra oficina ', '0.00', '2024-08-14 01:16:39', '2024-08-14 01:17:09', 4, 0, '[{\"id\": \"96\", \"label\": \"FOIA\"}]', '0000-00-00', 0, 1),
(44, 71, 50, 194, 'VAWA + I-485 + I-765', 'Offender partner has a protection order and was arrested for domestic violence may 2024, they have a 4 years old daughter usc and he is also USC, we will use the registration papers of her daughter to prove that he is a USC.  and present I-360 for 1250 I-485 for 2500 plus I-131 for 0.00', '3750.00', '2024-08-14 02:35:04', '2024-08-14 02:35:04', 1, 0, '[{\"id\": \"63\", \"label\": \"AOS Advance Parole\"}]', '0000-00-00', 0, 1),
(45, 67, 50, 183, 'Prosecutorial Discretion', 'vamos a terminar la corte de ella y los 2 hijos por haber entrada antes del 2019 y no estar sujeta a prioridad del gobierno, vamos a recomendarle la mudanza al condado de Dallas para que tenga la oportunidad de sacar SIJS para ambos niños ', '2000.00', '2024-08-14 03:37:20', '2024-08-14 03:37:20', 1, 0, '[]', '0000-00-00', 0, 1),
(46, 73, 50, 78, 'I-130 + NVC', 'Esposo tiene 9 anos desde su ultima salida de los EU, esta sujeto al castigo permanente por lo que le solicitamos I-130 x 1500 + NVC x 3000 + I-212 x 5000, Hijo USC va a pedirlo y madre LPD pedirá el Perdón.  Hijo de 7 anos madre lo pedirá I-130 x 1500 + NVC X 3000', '4500.00', '2024-08-14 04:12:00', '2024-08-14 04:12:00', 1, 0, '[]', '0000-00-00', 0, 1),
(47, 72, 50, 107, 'I-130+ I-601A + NVC', 'Prospective vive con Novia LPR of more than a year of status, informal husband entered the US with a working visa and they plan to legalize him. La I-130 se va a presentar ahora por si ella falla el examen. Petition se va presentar para Arreglar en Cd Juarez. ', '10500.00', '2024-08-14 04:23:23', '2024-08-14 04:23:23', 1, 0, '[]', '0000-00-00', 0, 1),
(48, 78, 50, 130, 'Bond Hearing', 'Su pareja tiene corte en el 2025 y fue detenida por una pelea con una cuñada y le llamaron a la policía. El cargo criminal es de Garland TX. Ella entro en el 2019 y  su numero A es 201-710-600\r\nsu nombre es Ana Samari Antunez, se encuentra detenida en Bluebonnet correctional facility no le han asignado corte de inmigración. she has time server probablemente ', '2500.00', '2024-08-17 03:14:04', '2024-08-17 03:14:04', 1, 0, '[]', '0000-00-00', 0, 1),
