(50, 82, 50, 199, 'PIP 2024 / I-131F', 'Cliente presento una I-130 en otro despacho pero el proceso de 601 A no ha empezado. Entro a los 8 anos de edad a los estados unidos no tiene record criminal y esta casada con un ciudadano americano hace mas de 2 anos. \r\nSe le dio un precio de 2500 por el Parole 2024 ', '2500.00', '2024-08-20 22:55:10', '2024-08-20 22:55:10', 1, 0, '[{\"id\": \"64\", \"label\": \"I-485 ADJUSTMENT OF STATUS\"}]', '0000-00-00', 0, 1),
(51, 87, 50, 107, 'I-130+ I-601A + NVC', 'COB 3 times on the Border, Never provided fake information on the 3 encounter. Client has prior FOIA and claim the FOIA is clean we will have to see before we make a determination on that. \r\nwe will recommend petition combo I-130 x 1750+  I-601 A x 5000 + NVC x 3750. Esposo my have a criminal record that do not want to disclose to wife (Warning) \r\nwe will haver to speak with husband first ', '10.00', '2024-08-20 23:26:30', '2024-08-20 23:26:30', 1, 0, '[]', '0000-00-00', 0, 1),
(52, 83, 50, 199, 'PIP 2024 / I-131F', 'Vino con Visa 1997 y se quedo hasta el 2001 cuando se fue a Mexico y cuando regreso le quitaron la visa puede que sea mis representaciones o fraude e incluso una deportación expedita. trato de entrar ilegal y fue capturado y luego entro y pudo pasar.  \r\nCliente va a traer copia de FOIA para verificar si tuvo orden de deportación o no, SI no hay orden de deportación cliente podrá presentar su parole ', '0.00', '2024-08-21 02:26:04', '2024-08-21 02:26:04', 1, 0, '[{\"id\": \"125\", \"label\": \"I-130 + I-485\"}]', '0000-00-00', 0, 1),
