(57, 106, 47, 96, 'FOIA', '<p>It\'s possible that he qualifies for Family Unity Program. We need to check docs of his mother who is LPR. He submitted I-485 but has aggravated unlawful presence and fraud. He does not want to go out 10 years. He has a criminal charge that was dismissed but caused his removal from the US in 2001. If it was an order of removal then he may also qualify for Stay of Removal. He is going to check if he has FOIAs already</p>\r\n<p>I recommend FOIA NRC- mom for family unity</p>\r\n<p>FOIA NRC and FBI for him&nbsp;</p>', '900.00', '2024-08-27 22:27:25', '2024-08-27 16:27:26', 1, 31191, '[{\"id\": \"123\", \"label\": \"FBI+FOIA\"}]', '0000-00-00', 0, 1),
(58, 106, 47, 96, 'FOIA', '<p>It\'s possible that he qualifies for Family Unity Program. We need to check docs of his mother who is LPR. He submitted I-485 but has aggravated unlawful presence and fraud. He does not want to go out 10 years. He has a criminal charge that was dismissed but caused his removal from the US in 2001. If it was an order of removal then he may also qualify for Stay of Removal. He is going to check if he has FOIAs already</p>\r\n<p>I recommend FOIA NRC- mom for family unity</p>\r\n<p>FOIA NRC and FBI for him&nbsp;</p>', '900.00', '2024-08-27 22:27:26', '2024-08-27 16:27:26', 1, 31192, '[{\"id\": \"123\", \"label\": \"FBI+FOIA\"}]', '0000-00-00', 0, 1),
(59, 105, 47, 109, 'Defensive Asylum Process With EOIR', '<p>She was a victim of rape in Honduras by the gangs and so was her daughter. Her daughter is in Miami Florida. I advised her of one year limit and she understoood. We are going to try asylum prep. Advised her to get a psychological evaluation. She has been raped multiple times since she was 7 years old.&nbsp;</p>\r\n<p>$3,500- to send asylum before December 15, 2024</p>\r\n<p>$1,000- I-765</p>\r\n<p>$1,500- 2 weeks before 1st court date</p>\r\n<p>$5,000- 6 months before final hearing</p>', '11000.00', '2024-08-27 23:16:57', '2024-08-27 17:16:58', 1, 31194, '[]', '2025-07-10', 0, 1),
