(62, 111, 50, 199, 'PIP 2024 / I-131F', 'Tiene Novia ciudadana americana le estoy ofreciendo la posibilidad del PIP 2024 o del Waiver I-601 A. Los Precios seria I-130 x 1750 + PIP 2024 X 3000. Posteriormente seria AOS or I-601A x 5000 + NVC x 3750. Clientes no tiene ningún arresto ni capturas con DHZ.  ', '3000.00', '2024-08-30 23:06:16', '2024-08-30 23:06:16', 1, 0, '[{\"id\": \"112\", \"label\": \"I-130 (U.S. Citizen)\"}]', '0000-00-00', 0, 1),
