(64, 112, 50, 192, 'PD + I-485', 'Corte en la ciudad de Houston  Sept 09, 2024 at 0900. Entro el 08 de Feb 2024, \r\n3000  pd con representación en corte y 2750 para el AOS una vez el caso sea terminado, Entro por CBP one segunda audiencia asi que es correcto que se presente con abogado ese dia, si se puede conseguir un webex para el cliente seria positivo tambien para que no tenga que viajar de arizona siempre y cuando cancele el pago rápido, juez del caso es Ramos Maritza. ', '5750.00', '2024-08-31 04:26:50', '2024-08-31 04:26:50', 1, 0, '[]', '2024-09-09', 0, 1),
