(71, 118, 44, 167, 'Consultation / Cita', '<p>PC is consulting about his fiancee/girlfriend and brother who are currently detained el Laredo, Texas. It seems like both are being subjected to Expidited removal, likely have an order of removal, and are awaiting CFI process.&nbsp;</p>\r\n<p>&nbsp;</p>\r\n<p>Quoted 2,500 to do a parole request for each. Explained the low probability of success. Explaiend the urgent need to send as much sup. evid. regarding Fear of Return to each detainee.&nbsp;</p>\r\n<p>PC seemed very stressed regarding his current attorney, Oscar A. Ruiza of the Angle guardian General Help NPORG, who filed an affirmative I-589 on behalf of his girlfriend an \"Keeping Fams Together\" application. I do not think this person is a member of ANY State Bar Association. USCIS does not have jurisdiction over an I-589 where the applicant is subject to expidited removal and has an order of removal wich is likely the case. As to the Keeping Fams Together Application, there is no legal basis for which to request this immigration benefit. The PC is likely a victim of the unathorized practice of law as he paid $750 or around that sum for services for which his loved ones are ineligable.&nbsp;</p>\r\n<p>&nbsp;</p>', '2500.00', '2024-09-04 03:41:08', '2024-09-03 21:41:09', 1, 31305, '[{\"id\": \"188\", \"label\": \"ICE Parole Request\"}]', '0000-00-00', 0, 1),
(72, 122, 50, 125, 'I-130 + I-485', 'Client enter with visa to the USA is elegible to AOS i-130x 1750 + I-485X 3500 +I-1765x 0. Client also has 2 Mexican children living abroad we will charge each one of the 1500 x the I-130 + 3000 x NVC ', '5250.00', '2024-09-04 03:48:56', '2024-09-04 03:48:56', 1, 0, '[]', '0000-00-00', 0, 1),
(73, 134, 44, 167, 'Consultation / Cita', '<div class=\"mb-2 text-center text-lg\">\r\n<div>PC MARRIED TO USC BY BIRTH. Already has I-130 and I-601A APPROVED. EOIR Proceedings are Admin Closed. Already filed PIP (BIDEN 2024)</div>\r\n<div>&nbsp;</div>\r\n<div>Prior Crim: Arrest for Drug trafficing resulted in Nole Prosec, possible Fraud case based on fake Social.&nbsp;</div>\r\n<div>&nbsp;</div>\r\n<div>PC MUST file&nbsp;MTD: $2,500.00</div>\r\n<div>&nbsp;</div>\r\n<div>&nbsp;</div>\r\n<div>AGUIRRE, MARCELO DE JESUS</div>\r\n<div class=\"mx-2 text-gray\">|</div>\r\n<div class=\"mr-1 whitespace-nowrap\">A-Number:</div>\r\n<div class=\"whitespace-nowrap\">205-503-686</div>\r\n</div>\r\n<div class=\"mb-2 text-center text-lg\">The immigration judge issued an <strong>ADMINISTRATIVE DECISION</strong>.</div>\r\n<section>\r\n<div class=\"p-2\">\r\n<div class=\"font-bold uppercase\">Decision Date</div>\r\nSeptember 2, 2014</div>\r\n<div class=\"p-2\">\r\n<div class=\"font-bold uppercase\">Court Address</div>\r\n<div>333 SOUTH MIAMI AVE., STE.700</div>\r\n<div>MIAMI, FL 33130</div>\r\n</div>\r\n</section>', '2500.00', '2024-09-07 03:45:55', '2024-09-06 21:45:55', 1, 31338, '[{\"id\": \"183\", \"label\": \"Prosecutorial Discretion\"}]', '0000-00-00', 0, 1),
(74, 18, 11, 167, 'Consultation / Cita', '<p>Prueba de producci&oacute;n para documentos&nbsp;</p>', '1112.00', '2024-09-09 12:42:53', '2024-09-09 06:42:53', 1, 31370, '[{\"id\": \"176\", \"label\": \"CONSULTA / PROMO\"}]', '2024-09-30', 0, 1),
(75, 135, 44, 126, 'I-601A + NVC', '<p>PC has 2 entries the first in 99 No Contact with ICE/CBP but in 2010 PC was detained by ICE at a \"Redada\" on the Highway which resulted in a VD. PC Re-entered in 2010 and has remained in US since.&nbsp;</p>\r\n<p>PC Divorced</p>\r\n<p>PC has 2 USC Sons/Daughters 23 and 24 yrs old.&nbsp;</p>\r\n<p>PC has an LPR Mother, who gained LPR status through USC Spouse the PC\'s stepfather. Date of Marriage occured AFTER PC turned 21 years old.</p>\r\n<p>PC has an EAD category C09P - which stands for Pending AOS with Approved Advance Parole. I am not sure why the PC applied for AOS in the US if he was not Admitted or Paroled, none of his family is/was in the army, not a victim of a crime.&nbsp;</p>\r\n<p>Requested that PC bring a copy of his File, this will determine if he requires FOIAS (ICE, CBP, OBIM, FBI, and USCIS) which will be an additional price if needed. PC will need an I-601A Waiver and NVC Processing</p>\r\n<p>&nbsp;</p>\r\n<p>&nbsp;</p>', '8750.00', '2024-09-10 03:43:01', '2024-09-09 21:43:02', 1, 31382, '[]', '0000-00-00', 0, 1),
(76, 132, 44, 167, 'Consultation / Cita', '<p>Contact with ICE/CBP in 98 and was returned.</p>\r\n<p>Rentry in 98 NO Contact with ICE/CBP. Departed in 99 (less than a year) when PC\'s mother died.</p>\r\n<p>rentry in 2000 NO CONTACT has remained in US since.&nbsp;</p>\r\n<p>USC Son 21 in 12/23/2024.&nbsp;</p>\r\n<p>PC is married but No contact since 2014.&nbsp;</p>\r\n<p>PC was previously arrested/ pled guilty of Misd. Domestic Violence probably Assault Domestive Violence, Complied with Probation</p>\r\n<p>Has NO QR for waiver.&nbsp;</p>\r\n<p>IF PC porceeds with I-130, the Petition will not move CP. Explained PC that the petition will be filed in case there happens to be a CHANGE IN LAW similar to the 245i Life Act&nbsp;</p>\r\n<p>&nbsp;</p>', '1750.00', '2024-09-10 04:05:40', '2024-09-09 22:05:41', 1, 31383, '[{\"id\": \"112\", \"label\": \"I-130 (U.S. Citizen)\"}]', '0000-00-00', 0, 1),
(77, 59, 29, 96, 'FOIA', '<p>VF: Cliente vino a la oficina, tuvoi dos capturas en el ano 2013 se le dio de cortesia un CBP FOIA regular para tarter de ver la information que no aparece en el obvio foia tomado en otra oficina</p>', '0.00', '2024-09-10 22:26:18', '2024-09-10 16:26:19', 1, 31389, '[]', '0000-00-00', 0, 1),
(78, 139, 50, 125, 'I-130 + I-485', 'cliente puede ajustar status por medio de lio US C mayor de 21 anos con su entrada por parole por TPS. \r\nI-130X 1750 + I-485X 3750. Client entro y fue capturado en la frontera soltado en USA pero numero A no muestra proceso en corte de immigracion podria haber dos numeros A en caso de que AOS sea cerrado administrativamente habría que pedir la reapertura y terminación del caso en la corte de immigracion por 2500 \r\n\r\n\r\n  Esposa podria obtener residencia via proceso consular I-130x 1750 + I-601 Ax 5000 + NVC x 3750 ', '5500.00', '2024-09-10 22:40:42', '2024-09-10 22:40:42', 1, 0, '[]', '0000-00-00', 0, 1),
(79, 136, 44, 96, 'FOIA', '<p>PC has prior order of removal from 13 years ago. not sure if order of removal from EOIR or at the border. Request bundle of FOIAs: ICE, CPB, FBI, OBIM, USCIS, EOIR. Has 1 minor daughter with health issues, might be able to proceed with EOIR 42B.&nbsp;</p>', '850.00', '2024-09-12 00:42:28', '2024-09-11 18:42:29', 1, 31407, '[]', '0000-00-00', 0, 1),
(80, 145, 44, 167, 'Consultation / Cita', '<p>PC is detained at the Female ICE Detention Facility in Houston. WIll have a CFI Review with the IJ within 7 days. May have to be in person. Confirmed with Houston Office to see if the Attorney there is available to do it and they confirmed they were.&nbsp;</p>\r\n<p>This case will be handled by Houston Office.&nbsp;</p>\r\n<p>Will charge $3,000 to attend Court. PC\'s daugher Shirley Yaguai has evidence that will help PC\'s case</p>\r\n<p>&nbsp;</p>', '3000.00', '2024-09-12 02:11:58', '2024-09-11 20:11:59', 1, 31412, '[]', '0000-00-00', 0, 1),
(81, 152, 46, 160, 'Asylum Application Prep', '<p>PC having her 3rd MCH on Oct. 23/2024.&nbsp;</p>\r\n<p>PC participated in the on Nicaraguan Student Movement. On 2019 Left Nicaragua and spent around 4 yrs in Panama. Entered the US on 2022. PC has already a work permit based on I-589 made by a Notary. On August 2024, she was also a victim of Domestic Violence from her NLS European boyfriend here in the U.S. Boyfriend was arrested b/ she callled the police. No further action has been made by her. She thinks ICE took him under custody, and probably already removed him from the U.S.&nbsp; <strong>Case # (</strong>242331447) Travis County</p>\r\n<ol>\r\n<li>I-589 (No Rep) - Deadline September 30/2024.&nbsp; &nbsp;</li>\r\n</ol>\r\n<p>&nbsp; &nbsp; &nbsp; 2. U Visa Certifiication&nbsp;</p>\r\n<p>&nbsp;</p>\r\n<p>&nbsp;</p>', '6.00', '2024-09-17 22:07:04', '2024-09-17 16:07:06', 1, 31508, '[{\"id\": \"138\", \"label\": \"U-Visa Certification\"}]', '2024-10-23', 0, 1),
