(86, 158, 44, 167, 'Consultation / Cita', '<p>PC is detained at&nbsp;</p>\r\n<h3>Facility Page</h3>\r\n<p class=\"blurb-title\">Detention Information For:</p>\r\n<div class=\"info\">\r\n<div class=\"detainee_name\">JOSE RICARDO GAVIDIA-CEDILLOS</div>\r\n<div><span class=\"row_title\">Country of Birth:&nbsp;</span>El Salvador</div>\r\n<div><span class=\"row_title\">A-Number:&nbsp;</span>221220141</div>\r\n</div>\r\n<p class=\"blurb-title\">Current Detention Facility:</p>\r\n<div class=\"facility-info info\">\r\n<p>KARNES COUNTY IMMIGRATION PROCESSING CENTER</p>\r\n<p>409 FM 1144</p>\r\n<p>&nbsp;</p>\r\n<p>&nbsp;</p>\r\n<p>KARNES CITY,&nbsp;TX 78118</p>\r\n<p><span class=\"note\">Visitor Information:</span> (830) 254-2000</p>\r\n<p>&nbsp;</p>\r\n<p>Once payment is paid in FULL send g28 with return receipt requested and prepaid lable for g28 to be sent back to and rom&nbsp; detention facility signed by PC. Then email signed g28 to Houston Asylum Office for CFI Interview which should be WEBEX or Telephone.</p>\r\n<p>Email ICE and Request Attorney/Client Meeting with PC to be carried out via Telephone/Webex.&nbsp;</p>\r\n<p>Request \"BOND DOCS\" from PC\'s wife, as well as ANY evidence regarding fear of return.&nbsp;</p>\r\n<p>PC\'s FEAR OF RETURN: Salvadoran Male percieved to be Gangmember by Salvador\'s Government. Already senteced to 5 years in jail.&nbsp;</p>\r\n<p>There is a chance we may miss CFI interview due to time constraints, if so, the 3,500 will be credited to the CFI REVIEW by IJ or Asylum Prep (NO REP) as the case me be.</p>\r\n</div>', '3500.00', '2024-09-19 02:39:38', '2024-09-18 20:39:39', 1, 31537, '[{\"id\": \"130\", \"label\": \"Bond Hearing\"}]', '0000-00-00', 0, 1),
(87, 131, 44, 167, 'Consultation / Cita', '<p>Full bundle of FOIA = $850.00 then $350.00 to FU with Law enforcement. Screening for T-Visa Eligability.</p>\r\n<p>________</p>\r\n<p>Request Full Bundle of FOIA (ICE, CBP, FBI, OBIM, USCIS, Will need to follow up with with Police Records Request/ DA Records request to confirm T-Visa Eligability.&nbsp;</p>\r\n<p>________</p>\r\n<p>PC entered 3 times to US EWI:</p>\r\n<p>1st- March 2022- detained at border sent back</p>\r\n<p>2nd-April 2022- detained at border sent back</p>\r\n<p>3d- April 2022 with ICE/CBP, PC was in a trailer with 80 people. Sent back to MEXICO. Lagarita POE&nbsp;or Houston police (POSIBE T VISA since law enforcement was present)</p>\r\n<p>4th - May 7, 2022-EWI not contact</p>\r\n<p>______</p>\r\n<p>&nbsp;</p>', '850.00', '2024-09-19 22:56:27', '2024-09-19 16:56:27', 1, 31545, '[{\"id\": \"96\", \"label\": \"FOIA\"}]', '0000-00-00', 0, 1),
(88, 167, 50, 67, 'I-751  Removal of Condition', 'Client necesita remover sus condiciones y esta separándose de tu esposa,  I-751, su tarjeta vence el 7 de marzo del 2025, en caso de que el divorcio no este resuelto para esa época presentaremos una 751 basándonoslos en violencia y maltrato cruel por parte de la esposa USC.. en caso de que se tenga que presentar dos aplicaciones la segunda sera por 2000  USD. Cliente dice que va a tratar de empezar en octubre de 2024 ', '2500.00', '2024-09-23 23:09:33', '2024-09-23 23:09:33', 1, 0, '[]', '0000-00-00', 0, 1),
