(90, 176, 50, 109, 'Defensive Asylum Process With EOIR', 'cliente nacional cubano, estaba a cargo de una UEB de commercio y el gobierno lo detuvo en varias ocaciones por negarse a proporcionar información fraudulenta a consumidores tiene varios arrestos y citaciones con esa información.  Recibió Torturas Físicas y mentales rotura en la cabeza por parte del gobierno, esposa testigo mensaje de textos al padre con fotografías alegando la situación.\r\n\r\npago 4 mil primera corte 6 mil restante, petición de asilo ya se encuentra presentada, al día de hoy visitng judge es el asignada a las 8:30 Am. Papa trabajaba para la compañía y se tomo también represalias adicionales contra el cuando padre emigra a usa ', '10000.00', '2024-09-24 22:43:27', '2024-09-24 22:43:27', 1, 0, '[]', '2025-03-10', 0, 1),
