(97, 179, 50, 160, 'Asylum Application Prep', 'venezolano, trabajo en la administración de recursos humanos en el gobierno de maduro, y en los temas de la gasolina. se empezó a notar robo y hurto de la gasolina y empezó investigación comercial. 3500 asilo prep + asistencia de abogado 750 usd. @ months prior individual hearing 1500 to change venue to dallas court + motion to withdraw.  1 er 765 pro bono ', '5750.00', '2024-10-01 22:38:13', '2024-10-01 22:38:13', 1, 0, '[]', '2024-10-15', 0, 1),
(98, 197, 44, 167, 'Consultation / Cita', '<p>PC states that he USCIS approved I-130 through a USC Parent in 2019 but that there is another petition from 1993 when his grandfather petitioned the PC\'s dad. Possible 245i</p>\r\n<p>FOIA under PC\'s dad\'s name AND PC\'s GrandfatherUSCIS and NVC inquiery</p>\r\n<p>FOIA for PC USCIS.</p>\r\n<p>A total of 3 FOIAs</p>\r\n<p>&nbsp;</p>\r\n<p>$850- Records request FOIA</p>', '850.00', '2024-10-01 22:57:50', '2024-10-01 16:57:51', 1, 31711, '[{\"id\": \"96\", \"label\": \"FOIA\"}]', '0000-00-00', 0, 1),
