(103, 188, 44, 167, 'Consultation / Cita', '<p>PC has an EWI from 98 and was sent back to mexico. PC is concerned about MISREP due to using a fake name, wrong DOB, wrong Nationality. She has TPS and has already traveled on the Travel Permit has USC Son.&nbsp;</p>\r\n<p>Step 1:</p>\r\n<p>Request FOIA: CBP, ICE, FBI for 500.00</p>\r\n<p>I-130: $1,500.00 PLUS FEES</p>\r\n<p>If FOIA COMES back clear, no prior order of removal, file AOS.&nbsp;</p>\r\n<p>Step 2:</p>\r\n<p>AOS: $3,750.00 PLUS FEES</p>\r\n<p>&nbsp;</p>', '6.00', '2024-10-02 18:09:58', '2024-10-02 17:09:59', 1, 31731, '[{\"id\": \"96\", \"label\": \"FOIA\"}, {\"id\": \"125\", \"label\": \"I-130 + I-485\"}]', '0000-00-00', 0, 1),
(104, 214, 44, 109, 'Defensive Asylum Process With EOIR', '<p>MCH (Initial):&nbsp; 10/15/2024 at 8:30 Houston.&nbsp;</p>\r\n<p>1 year asylum filing deadline: Internal = 04/01/2025. Final = 05/10/2025</p>\r\n<p>If COURT REP = $10,000 total 500 to open 2500 to attend 2nd MCH. 2500 to send I-589</p>\r\n<p>if I-589 ONLY (NO COURT REP) = 5000 total, 2500 t0 send 2500 for EAD</p>', '10.00', '2024-10-03 20:24:44', '2024-10-03 19:24:45', 1, 31749, '[]', '0000-00-00', 0, 1),
(105, 210, 44, 117, 'MOTION TO REOPEN', '<p>A220-681-399</p>\r\n<p>MTR - 2,500. CL was subjected to MPP and also did not recieve Hearing Notice.&nbsp;</p>\r\n<p>CL needs to confirm address history especialy at the time of her in absentia order of removal August 22, 2023</p>', '2500.00', '2024-10-03 20:35:14', '2024-10-03 19:35:15', 1, 31750, '[]', '0000-00-00', 0, 1),
(106, 234, 44, 167, 'Consultation / Cita', '<p>*Appointment Rescheduled*</p>\r\n<p>Desideria Medina calling on behalf of detainee, the CL\'s name DOLORES-FLORENTINO, REYITO (A221104702). Not eligable for bond. It seems like IJ already affirmed the NEGATIVE CFI.&nbsp;</p>\r\n<p>Desideria has NO INFORMATION about the detainee.&nbsp;</p>\r\n<p>CL has a fear of return but was likely denied.&nbsp;</p>\r\n<p><span style=\"text-decoration: underline;\"><strong>EOIR CASE STATUS:</strong></span></p>\r\n<div class=\"mb-2 text-center text-lg\">The immigration judge issued a&nbsp;<strong>DECISION</strong>.</div>\r\n<section>\r\n<div class=\"p-2\">\r\n<div class=\"font-bold uppercase\">Decision Date</div>\r\nAugust 27, 2024</div>\r\n<div class=\"p-2\">\r\n<div class=\"font-bold uppercase\">Court Address</div>\r\n<div>1406 JACAMAN ROAD</div>\r\n<div>LAREDO, TX 78041</div>\r\n</div>\r\n</section>\r\n<p><span style=\"text-decoration: underline;\"><strong>ICE DETAINEE LOCATOR:</strong></span></p>\r\n<div class=\"results-row\"><span class=\"row_title\">Country of Birth :&nbsp;</span>Dominican Republic</div>\r\n<div class=\"results-row\"><span class=\"row_title\">A-Number:&nbsp;</span>221104702</div>\r\n<div>\r\n<div class=\"results-row\"><span class=\"row_title\">Status :&nbsp;</span>In ICE Custody</div>\r\n<div class=\"results-row\"><span class=\"row_title\">State:&nbsp;</span>TX</div>\r\n<div class=\"results-row\"><span class=\"row_title\">Current Detention Facility</span>:&nbsp;<span class=\"detention-link\">RIO GRANDE PROCESSING CENTER</span>\r\n<p class=\"detention-link-instructions\">* Click on the Detention Facility name to obtain facility contact information</p>\r\n<p class=\"detention-link-instructions\">&nbsp;</p>\r\n<p class=\"blurb-title\">Detention Information For:</p>\r\n<div class=\"info\">\r\n<div class=\"detainee_name\">REYITO DOLORES-FLORENTINO</div>\r\n<div><span class=\"row_title\">Country of Birth:&nbsp;</span>Dominican Republic</div>\r\n<div><span class=\"row_ti