(107, 216, 44, 167, 'Consultation / Cita', '<p>$2,500 for MCH/MTT</p>\r\n<p>$2,750 for CAA AOS</p>\r\n<p>&nbsp;</p>\r\n<p>CL is CUBAN Eligible to AOS per CAA BUT is in Removal Porceedings, need MTT in court, no time to file before hand Court per ACIS:</p>\r\n<section>Your upcoming&nbsp;<strong class=\"uppercase\">Master</strong>&nbsp;hearing is&nbsp;<strong class=\"uppercase\">in person</strong>&nbsp;on&nbsp;<strong>October 9, 2024</strong>&nbsp;at&nbsp;<strong>1:00 PM</strong></section>\r\n<section>\r\n<div class=\"p-2\">\r\n<div class=\"font-bold uppercase\">Judge</div>\r\nGemoets, Marcos</div>\r\n<div class=\"p-2\">\r\n<div class=\"font-bold uppercase\">Court Address</div>\r\n<div>1919 SMITH ST. 14TH FLOOR</div>\r\n<div>HOUSTON, TX 77002</div>\r\n<div>&nbsp;</div>\r\n<div>Court REP, send PD ASAP, file MTT ASAP PRIOR TO HEARING. this is the CL\'s 3 MCH reset. MUST BE PREPARED</div>\r\n</div>\r\n</section>', '5.00', '2024-10-03 21:20:45', '2024-10-03 20:20:45', 1, 31752, '[{\"id\": \"64\", \"label\": \"I-485 ADJUSTMENT OF STATUS\"}, {\"id\": \"161\", \"label\": \"Court Appearance\"}, {\"id\": \"177\", \"label\": \"Motion to Terminate\"}]', '0000-00-00', 0, 1),
