(112, 205, 44, 167, 'Consultation / Cita', '<p>PC Venezuelan, detained at Jena for over a YEAR, asylum denied, BIA appeal filed, BIA MTR Filed .&nbsp;</p>\r\n<p>&nbsp;</p>\r\n<p>PC Eligible for TPS, already filed.&nbsp;</p>\r\n<p>&nbsp;</p>\r\n<p>Need copy of File EOIR/BIA FOIA $350 in order to better assess options. Possibly refiling MTR</p>', '350.00', '2024-10-04 16:49:48', '2024-10-04 15:49:49', 1, 31772, '[{\"id\": \"96\", \"label\": \"FOIA\"}]', '0000-00-00', 0, 1),
(113, 219, 44, 167, 'Consultation / Cita', '<p>U- Cert Request Houston (Downtown) Incident Rep. # 1576940-01. Assault with deadly weapon, in 2022. May be too late. PC must decide to assume the risk of this incident being outside the internal policy deadlines by Houston PD. No arrest.&nbsp;</p>\r\n<p>&nbsp;</p>\r\n<p>PC has an A205-342-091, need to request all the PC\'s immigration documents from the PC, if they dont have them will need FULL BUNDLE OF FOIA\'s for $850</p>', '8.00', '2024-10-04 17:34:01', '2024-10-04 16:34:02', 1, 31773, '[{\"id\": \"96\", \"label\": \"FOIA\"}, {\"id\": \"138\", \"label\": \"U-Visa Certification\"}, {\"id\": \"111\", \"label\": \"U-Visa Nonimmigrant Petition\"}]', '0000-00-00', 0, 1),
