(121, 267, 50, 167, 'Consultation / Cita', 'Cliente entro mediante CBP One on MAY 31, 2023 SE LE VA A COBRAR 750 POR EAD en base a parole y 3500 por asilo prep, si podemos recuperar el reloj presentaríamos un Gad por asilo pro bono \r\n\r\n\r\nDreamers autoriza 2000 usd ', '4250.00', '2024-10-08 17:38:02', '2024-10-08 17:38:02', 1, 0, '[{\"id\": \"137\", \"label\": \"I-765 Work Authorization\"}, {\"id\": \"160\", \"label\": \"Asylum Application Prep\"}]', '2025-09-10', 0, 1),
(122, 249, 44, 167, 'Consultation / Cita', '<p>Possible CL was detained on Sept. 5/ 2024&nbsp; by ICE on New Mexico. It must be that&nbsp;</p>\r\n<p>An IJ issued a Decision on Oct. 3, 2023. He had a Credible Fear Interview already, which resulted in NO FEAR.</p>\r\n<p>Before 2023, he tried to enter several times. Wife wasn\'t cleared about this past entries.&nbsp;</p>\r\n<p>Wife said he has NO CRIMINAL HISTORY.&nbsp;</p>\r\n<p>They have a 5 year old U.S Citizen son.&nbsp;</p>\r\n<p>&nbsp;</p>', '2500.00', '2024-10-08 19:01:00', '2024-10-08 18:01:01', 1, 31835, '[{\"id\": \"151\", \"label\": \"Stay of Removal\"}]', '0000-00-00', 0, 1),
(123, 160, 50, 167, 'Consultation / Cita', 'persecution en Cuba por orientation sexual, puede ser buen testigo. Arrestado, maltratado y abusado por la policía cubana, Ya presento caso de asilo en la corte de inmigración.  1er EAD Pro Bono \r\n\r\n!ra Corte 3500 \r\nIndividual 4500 ', '8000.00', '2024-10-08 20:21:13', '2024-10-08 20:21:13', 1, 0, '[{\"id\": \"109\", \"label\": \"Defensive Asylum Process With EOIR\"}]', '2024-12-02', 0, 1),
(124, 265, 46, 167, 'Consultation / Cita', '<p>Possible CL. Entered on December 31/2022 with Tourist Visa.&nbsp;</p>\r\n<p>Girlfriend/ Cuban/ Paroled on Feb 28/2024. (She still has to Wait for one year +1day)&nbsp;</p>\r\n<p>Plans of getting Married. And then proceed with CAA, I-485 for BOTH.&nbsp;</p>\r\n<p>&nbsp;</p>\r\n<p><strong><span style=\"text-decoration: underline;\">$2,750.00 X 2</span>&nbsp; + ($1,440.00 x 2) <span style=\"text-decoration: underline;\">Immigration Fee</span></strong></p>', '8.00', '2024-10-08 20:50:42', '2024-10-08 19:50:42', 1, 31841, '[{\"id\": \"64\", \"label\": \"I-485 ADJUSTMENT OF STATUS\"}]', '0000-00-00', 0, 1),
(125, 271, 50, 115, 'SIJS + Court', 'We going to need client bring the EOIR number to evaluate in which state the case is on the Inmigration court, but we can proceed with a 2000 USD payment for I-360, once is approved we can also charge 750 for the EAD after wards we will be able to determine the price for a possible MTRand terminate plus AOS ', '2000.00', '2024-10-08 21:29:09', '2024-10-08 21:29:09', 1, 0, '[]', '0000-00-00', 0, 1),
(126, 166, 50, 167, 'Consultation / Cita', 'entered US on May 27, 2019 and have a pending court on December 4, 2024 in San Antonio TX. Spouse is a US citizen she entered with parole and and have an I-130 Approved. 3000 Per PD with representation plus 3750 for the adjustment of status ', '6750.00', '2024-10-08 21:40:17', '2024-10-08 21:40:17', 1, 0, '[{\"id\": \"64\", \"label\": \"I-485 ADJUSTMENT OF STATUS\"}, {\"id\": \"183\", \"label\": \"Prosecutorial Discretion\"}]', '2024-12-04', 0, 1),
(127, 269, 50, 167, 'Consultation / Cita', 'Presentar asilo ante USCIS, sin representación en la cort\r\n\r\nDreamers 2000 usd ', '3500.00', '2024-10-08 22:34:28', '2024-10-08 22:34:28', 1, 0, '[{\"id\": \"160\", \"label\": \"Asylum Application Prep\"}]', '0000-00-00', 0, 1),
(128, 233, 50, 167, 'Consultation / Cita', 'Clientes tiene 4 hijos menores de 18 anos, cuyo padre los abandono en EL Salvador, cliente vive en Hurst TX y entraron el 22 de Dic de 2022, recibieron orden de deportacion en ausencia en Mayo 3, 2023. números A de madre 244-008-556 y hacia arriba. cliente debe mudarse a Dallas County. son 2000 cada 1. ', '2000.00', '2024-10-08 23:43:51', '2024-10-08 23:43:51', 1, 0, '[{\"id\": \"84\", \"label\": \"IV.I-360.Special Immigrant Petition\"}]', '0000-00-00', 0, 1),
(129, 258, 46, 167, 'Consultation / Cita', '<p>Possible CL entered with Tourist Visa on Oct 1, 2021, expires May 10, 2026 (10 years).&nbsp;</p>\r\n<p>She has several entrance to the U.S.&nbsp;</p>\r\n<p>Her brother is a U.S Citizen.&nbsp;</p>\r\n<p>She wants a work permit. But her brother can Petition I-130 and then proceed w/ a I-485. And eventually become a LPR. But this will take 10-15yrs. She said she is not interested in a Petition right now, but on a WP.&nbsp;</p>\r\n<p>I advise her that under her current situation she can\'t apply for a WP.</p>\r\n<p>&nbsp;</p>', '5.00', '2024-10-09 17:11:44', '2024-10-09 16:11:45', 1, 31866, '[{\"id\": \"125\", \"label\": \"I-130 + I-485\"}]', '0000-00-00', 0, 1),
(130, 256, 46, 167, 'Consultation / Cita', '<p>Possible CL entered the U.S on Nov 09, 2022 W/ B2.&nbsp;</p>\r\n<p>Has a LPR father w/ expired green card. He is on the process on renewal. Been a LPR since 2005 (brother petitioned him).&nbsp;</p>\r\n<p>She is 21+ not married.&nbsp;</p>\r\n<p>She has a minor daughter U.S Citizen.&nbsp;</p>\r\n<p>*Possible CL was interest in having WP based on her I-94. She can\'t based on her Class admission.&nbsp;</p>\r\n<p>*Suggested: Father/Naturalization then 1-130 Petition/1-485&nbsp;</p>\r\n<p>*Other suggestion: Wait fathers LPR renewal and filed a 1-130/I-485.&nbsp;</p>\r\n<p>&nbsp;</p>\r\n<p>$700 for Green card renewal + 415, Immig. Fee&nbsp;</p>\r\n<p>$5,500 for I-130 + I-485&nbsp;</p>', '6.00', '2024-10-09 19:20:15', '2024-10-09 18:20:16', 1, 31873, '[{\"id\": \"66\", \"label\": \"I-90 Greencard Renewal/Replacement\"}, {\"id\": \"125\", \"label\": \"I-130 + I-485\"}]', '0000-00-00', 0, 1),
(131, 272, 46, 64, 'I-485 ADJUSTMENT OF STATUS', '<p>Possible CL entered Dec. 30, 2023. Arrived from Cuba. She was Paroled.&nbsp;</p>\r\n<p>Her Son who is an adult was paroled. They are NOT in removal proceedings.&nbsp;</p>\r\n<p>Son traveled to Cuba because his 13 year old half brother has leucemia and needed a medication that was not found in Cuba.&nbsp;</p>\r\n<p>Son is still in Cuba and mother&nbsp; was concerned that he would not have his parol again in his entry and if the better way was to travel from Cuba to Mexico and enter w/ CBP One.&nbsp;</p>\r\n<p>I address to her that he will not be paroled for a second time. And that the idea of traveling to Mexico can work, but to bring with him all the Medical Records of his half brother, as proof of evidence.&nbsp;</p>\r\n<p>Suggestions: For Mother.&nbsp;</p>\r\n<p>I-485 CAA, after December 31, 2024,&nbsp;</p>\r\n<p>$2,750.00 + Immigration Fees&nbsp;</p>', '2750.00', '2024-10-09 20:17:12', '2024-10-09 19:17:13', 1, 31878, '[]', '0000-00-00', 0, 1),
(132, 274, 46, 192, 'PD + I-485', '<p>Possible CL and girlfriend (Cubans) were Paroled, both entered Dec. 26, 2023.&nbsp; *He can apply for LPR after Dec.27,2024.&nbsp;</p>\r\n<p><span style=\"text-decoration: underline;\">He &amp; Girlfriend </span>are in Removal Proceedings. Initial MCH Nov. 17/2026 @t 1:00pm in Dallas</p>\r\n<p>Suggestions:&nbsp;</p>\r\n<p>I-485&nbsp;</p>\r\n<p>$2,500 x 2 = 5,000.&nbsp; + Immig Fee $1,440.00 (x2)</p>\r\n<p>PD/MTD (Pro Se)&nbsp;</p>\r\n<p>$2,000 x 2= $4,000</p>\r\n<p>&nbsp;</p>\r\n<p>&nbsp;</p>', '9.00', '2024-10-10 18:14:06', '2024-10-10 17:14:07', 1, 31886, '[]', '0000-00-00', 0, 1),
(133, 287, 44, 167, 'Consultation / Cita', '<section class=\"text-center mb-8\">\r\n<div class=\"flex flex-wrap font-bold font-serif justify-center text-lg\">\r\n<div class=\"mr-1\">PC\'s DOE: 11/28/2023</div>\r\n<div class=\"mr-1\">FEAR of Return = Generalized Conditions + Murdered Uncle</div>\r\n<div class=\"mr-1\">&nbsp;</div>\r\n<div class=\"mr-1\">I-589 NO COURT REP</div>\r\n<div class=\"mr-1\">&nbsp;</div>\r\n<div class=\"mr-1\">&nbsp;</div>\r\n<div class=\"mr-1\">Info on ACIS as of TODAY:</div>\r\n<div class=\"mr-1\">Name:</div>\r\n<div>MACHADO-TROCHEZ, SINTIA LORENA</div>\r\n<div class=\"mx-2 text-gray\">|</div>\r\n<div class=\"mr-1 whitespace-nowrap\">A-Number:</div>\r\n<div class=\"whitespace-nowrap\">245-517-104</div>\r\n<div class=\"mx-2 text-gray\">|</div>\r\n<div class=\"mr-1 whitespace-nowrap\">Docket Date:</div>\r\n<div>2/22/2024</div>\r\n</div>\r\n</section>\r\n<div class=\"grid md:grid-cols-2 md:grid-rows-2 gap-6 items-baseline\">\r\n<section class=\"h-full row-span-4\">\r\n<div class=\"caseInfoCard grid grid-cols-1 grid-rows-caseInfo h-full px-4 py-4\"><header class=\"font-bold font-serif my-2 text-lg lg:text-2xl\"><img class=\"align-baseline inline mr-2\" src=\"data:image/svg+xml;base64,\" alt=\"Hearing icon\">Next Hearing Information</header>\r\n<section class=\"bg-white-actual px-3 py-4 text-center\">\r\n<section>Your upcoming&nbsp;<strong class=\"uppercase\">Master</strong>&nbsp;hearing is&nbsp;<strong class=\"uppercase\">in person</strong>&nbsp;on&nbsp;<strong>January 22, 2025</strong>&nbsp;at&nbsp;<strong>1:00 PM</strong></section>\r\n<section>\r\n<div class=\"p-2\">\r\n<div class=\"font-bold uppercase\">Judge</div>\r\nJoyce, Jacquelyn J.</div>\r\n<div class=\"p-2\">\r\n<div class=\"font-bold uppercase\">Court Address</div>\r\n<div>8701 S. GESSNER RD</div>\r\n<div>HOUSTON, TX 77074</div>\r\n</div>\r\n</section>\r\n</section>\r\n</div>\r\n</section>\r\n</div>', '5000.00', '2024-10-10 20:50:53', '2024-10-10 19:50:54', 1, 31891, '[{\"id\": \"109\", \"label\": \"Defensive Asylum Process With EOIR\"}]', '0000-00-00', 0, 1),
(134, 279, 46, 167, 'Consultation / Cita', '<p>Att. Dario did the Consultation. And suggested the following:&nbsp;</p>\r\n<p>Possible CL is elegible for an I-589 Prep.&nbsp;</p>\r\n<p>$5,000- I-589&nbsp;</p>\r\n<p>1) $3,500 Needs to be PAID IN FULL on or before <strong>December 7, 2024.</strong> (DEADLINE)</p>\r\n<p>2) Next $2,500 for (1) Work permit.&nbsp;</p>\r\n<p>&nbsp;</p>', '5.00', '2024-10-11 17:00:22', '2024-10-11 16:00:23', 1, 31903, '[{\"id\": \"160\", \"label\": \"Asylum Application Prep\"}]', '0000-00-00', 0, 1),
(135, 282, 44, 167, 'Consultation / Cita', '<p>PC will request copy of documents from prior attorney and reschedule appoint.&nbsp;</p>\r\n<p>IF PC unable to procure documetns will need to do FULL BUNDLE OF FOIAS\'s</p>', '850.00', '2024-10-11 17:10:23', '2024-10-11 16:10:24', 1, 31904, '[]', '0000-00-00', 0, 1),
(136, 263, 44, 167, 'Consultation / Cita', '<p>PC\'s Garifuna Asylum Claim was denied by the IJ on August 14, 204, Attempted to file Appeal but PC claims it was rejected two weeks ago, she did not have the documents with her during the consult.&nbsp;</p>\r\n<p>BIA appeal not in System but may argue exception if the case was rejected.&nbsp;</p>', '2500.00', '2024-10-11 17:30:03', '2024-10-11 16:30:03', 1, 31905, '[]', '0000-00-00', 0, 1),
(137, 288, 44, 167, 'Consultation / Cita', '<p>PC had a hearin on Oct 8, 2024 his 4 MCH, was offered VD, he refused. PCs FEAR OF RETURN to Venezuela = Political Opnion. Lived in CHILE for&nbsp; 6 years persuant to a \"RESIDENCIA DIFINITIVA\". PC\'s Fear of Return to CHile = Attempted Recruitment by Organized Crime and Xenophobia</p>\r\n<p>IJ granted Oral Motion to Pretermit for failer to take BIOMETRICS</p>\r\n<p>MTReconsider, no payment plan, DEADLINE November 6, 2024. Internal deadline: October 20, 2024.&nbsp;</p>\r\n<p>MUST FILE FBI BIOMETRICS, SEND I-589 BIOMETRICS, THEN SEND MTReconsideration</p>\r\n<p>&nbsp;</p>\r\n<p>&nbsp;</p>\r\n<p>&nbsp;</p>\r\n<p>&nbsp;</p>\r\n<p>&nbsp;</p>\r\n<p>&nbsp;</p>\r\n<p>&nbsp;</p>', '2500.00', '2024-10-11 18:03:17', '2024-10-11 17:03:18', 1, 31907, '[]', '0000-00-00', 0, 1),
(138, 289, 44, 110, 'Affirmative Asylum Process (USCIS)', '<p>Will file i-589 under husbands name, 1 year deadline in December. Both spouses participated in anti government protests. Minir son is so, daughter aged out</p>\r\n<p>&nbsp;</p>\r\n<p>Came with parole</p>', '5000.00', '2024-10-11 21:31:37', '2024-10-11 20:31:38', 1, 31910, '[]', '0000-00-00', 0, 1),
(139, 302, 44, 167, 'Consultation / Cita', '<p>U Cert Request: Armed Robbery - February 12, 2024 in Long Beach, California.&nbsp;</p>\r\n<p>Officer DAVID JAMES</p>\r\n<p>Charge Code 212.5 CPC</p>\r\n<p>&nbsp;</p>\r\n<p>Will Charge 3,500 for U-Cert. Then Proceed with U-Visa. Will not require waiver becasue came in with Tourist VISA</p>', '3500.00', '2024-10-14 16:31:14', '2024-10-14 15:31:15', 1, 31943, '[]', '0000-00-00', 0, 1),
(140, 297, 44, 167, 'Consultation / Cita', '<p>PC was either ordered removed or possibly VD in 1990. Claims that he was arrested for theft, possession of marijuana but was convicted for possession of marijuana ONLY. Informed PC of the likelily hood of the need for a waiver.&nbsp;</p>\r\n<p><em>IMPORTANT</em> THE WAIVER IS A 601 waiver NOT a 601A wiaver but 601 not an option on the list</p>\r\n<p>Quoted:&nbsp; $10,000 for I-130, NVC, I-601</p>\r\n<p>Will need 1,750 UPFRONT for I-130 lthe remained in payments&nbsp;</p>', '0.00', '2024-10-14 17:08:42', '2024-10-14 16:08:42', 1, 31948, '[{\"id\": \"107\", \"label\": \"I-130+ I-601A + NVC\"}]', '0000-00-00', 0, 1),
(141, 254, 44, 167, 'Consultation / Cita', '<section class=\"text-center mb-8\">\r\n<div class=\"flex flex-wrap font-bold font-serif justify-center text-lg\">\r\n<div>Consult is not for Jorge Huerta but for ZAPATA OSORIO, SANDRA GRIPSALIDA&nbsp;A-Number:241-412-866 See ACIS info as of the date of this consult below. Jorge is Sandra\'s boyfriend. Jorge was unable to explain why Sandra is not on the call.&nbsp;</div>\r\n<div>&nbsp;</div>\r\n<div>Removed in absentia: on July 3, 2024</div>\r\n<div>&nbsp;</div>\r\n<div>MTR based on having been arrested the day before hearing.&nbsp;</div>\r\n<div>&nbsp;</div>\r\n<div>________</div>\r\n<div class=\"mx-2 text-gray\">&nbsp;</div>\r\n<div class=\"mr-1 whitespace-nowrap\">Docket Date:</div>\r\n<div>8/24/2023</div>\r\n</div>\r\n</section>\r\n<div class=\"grid md:grid-cols-2 md:grid-rows-2 gap-6 items-baseline\">\r\n<section class=\"h-full row-span-4\">\r\n<div class=\"caseInfoCard grid grid-cols-1 grid-rows-caseInfo h-full px-4 py-4\"><header class=\"font-bold font-serif my-2 text-lg lg:text-2xl\"><img class=\"align-baseline inline mr-2\" src=\"data:image/svg+xml;base64,\" alt=\"Hearing icon\">Next Hearing Information</header>\r\n<section class=\"bg-white-actual flex items-center justify-center px-3 py-4 text-center\">\r\n<div class=\"flex flex-col justify-center items-center\"><img src=\"data:image/svg+xml;base64,\" alt=\"Clock\" width=\"42\" height=\"42\">\r\n<div class=\"text-2xl italic\">There are no future hearings for this case.</div>\r\n</div>\r\n</section>\r\n</div>\r\n</section>\r\n<section class=\"h-full row-span-4\">\r\n<div class=\"caseInfoCard grid grid-cols-1 grid-rows-caseInfo h-full px-4 py-4\"><header class=\"font-bold font-serif my-2 text-lg lg:text-2xl\"><img class=\"align-baseline inline mr-2\" src=\"data:image/svg+xml;base64,\" alt=\"Decision and Motion Information\">Decision and Motion Information</header>\r\n<section class=\"bg-white-actual px-3 py-4 text-center\">\r\n<div class=\"mb-2 text-center text-lg\">The immigration judge ordered&nbsp;<strong>REMOVAL</strong>.</div>\r\n<section>\r\n<div class=\"p-2\">\r\n<div class=\"font-bold uppercase\">Decision Date</div>\r\nJuly 3, 2024</div>\r\n<div class=\"p-2\">\r\n<div class=\"font-bold uppercase\">Court Address</div>\r\n<div>970 BROAD STREET, ROOM 1200</div>\r\n<div>NEWARK, NJ 07102</div>\r\n</div>\r\n</section>\r\n</section>\r\n</div>\r\n</section>\r\n</div>', '2500.00', '2024-10-14 18:21:17', '2024-10-14 17:21:17', 1, 31953, '[{\"id\": \"117\", \"label\": \"MOTION TO REOPEN\"}]', '0000-00-00', 0, 1),
(142, 292, 50, 149, 'NVC Inquiry', 'cliente tiene una orden de deportación desde el 2017 y se caso en 2017 con un LPR. Tienes 3 hijos que pueden ser pedidos por actual esposo. Primero meter un NVC ( Parece que han mantenido el caso abierto)  para ver si la petición sigue viva, posterior al NVC presentar. Cliente tiene order de deportación desde el 2019 en Houston numero A es 208-618-315. ella y 3 hijos. NVC inquiry X 500. + PD to reopen and terminate X 3500 + 8000 x 2 I-601A + NVC times 3 X 9000', '21000.00', '2024-10-14 21:43:41', '2024-10-14 21:43:41', 1, 0, '[{\"id\": \"126\", \"label\": \"I-601A + NVC\"}, {\"id\": \"183\", \"label\": \"Prosecutorial Discretion\"}]', '0000-00-00', 0, 1),
(143, 295, 50, 167, 'Consultation / Cita', 'Cliente se paso el ano en su aplicación de asilo vive en Miami, entro con parole el caso aun no esta ante EOIR presentar un asilo prep ante USCIS con alguna excepción a la regla ', '3500.00', '2024-10-14 21:53:08', '2024-10-15 03:17:00', 4, 0, '[{\"id\": \"110\", \"label\": \"Affirmative Asylum Process (USCIS)\"}]', '0000-00-00', 0, 1),
(144, 305, 50, 167, 'Consultation / Cita', 'Tienes corte en Houston el 5 de noviembre del 2024 en Greenspoint Houston 08:30 AM.  ciudadano Salvadoreño le explique lo de asilo Prep.  A# 245-807-660\r\n\r\nDreamers 2000 ', '3500.00', '2024-10-14 22:30:01', '2024-10-14 22:30:01', 1, 0, '[{\"id\": \"160\", \"label\": \"Asylum Application Prep\"}]', '0000-00-00', 0, 1),
(145, 314, 50, 167, 'Consultation / Cita', 'Stay of removal he has 4 USC under the age 6,  mother of all 4 kids was charged with juvenile abuse and one of the kids has a swollen brain and the grand mother currently has custody. \r\nhe is custodian father of all 3 of the other children and the charges for domestic violence was for the ex girlfriend. A# 088-512-509 client Antoni Alejandro Ortiz - Velasquez \r\n \r\nremoved  on 2016 pro ', '2500.00', '2024-10-14 22:59:28', '2024-10-14 22:59:28', 1, 0, '[{\"id\": \"151\", \"label\": \"Stay of Removal\"}]', '0000-00-00', 0, 1);
