INSERT INTO `clientes_estatus` (`id_cliente_estatus`, `nombre`, `descripcion`) VALUES
(1, 'Prospecto', 'Los clientes inician en estatus Prospecto en este estatus se crean con la información mínima necesaria y se les envía el formulario de admisión.'),
(2, 'Intake', 'Cuando un cliente llena el formulario de admisión cambia a estatus Intake. En este estatus se está esperando a que un usuario del sistema con el rol Recepción lo asigne a un abogado.'),
(3, 'Asignado', 'Esperando a que un abogado lo vea y decida si su caso es Elegible o No Elegible.'),
(4, 'Elegible', 'El abogado ha determinado que el caso del cliente es elegible para proceder.'),
(5, 'No Elegible', 'El abogado ha determinado que el caso del cliente no es elegible para proceder.'),
(6, 'Activo', 'El cliente está activo. Este estatus se modifica de manera manual.'),
(7, 'Inactivo', 'El cliente está inactivo. Este estatus se modifica de manera manual.'),
(8, 'Por Asignar', 'El cliente está esperando a ser asignado a un abogado para consultas online');
