INSERT INTO `comentarios_caso` (`id_comentario`, `id_caso`, `id_usuario`, `comentario`, `fecha_creacion`) VALUES
(10, 21, 10, 'c1', '2024-06-26 02:09:02'),
(11, 21, 10, 'c2', '2024-06-26 02:09:05'),
(15, 23, 10, 'comentario 2', '2024-07-09 03:23:38'),
(16, 23, 10, 'comentario 3', '2024-07-09 03:23:46'),
(18, 1, 10, 'Comentario de prueba 1 ', '2024-08-02 12:16:36'),
(19, 1, 10, 'Comentario de prueba 2', '2024-08-02 12:16:49'),
(20, 1, 10, 'Comentario de prueba 3', '2024-08-02 12:16:57'),
(21, 38, 53, 'Realicé una revisión del estatus del caso de [Nombre del Cliente] en el portal de USCIS. El aviso de acción (NOA1) ha sido emitido y recibido, confirmando que la solicitud de renovación/reemplazo de la Tarjeta Verde ha sido aceptada y está en proceso de revisión.\r\n\r\nEl cliente fue notificado sobre la emisión del NOA1 y se le explicó la importancia de mantenerlo seguro, ya que servirá como comprobante de que su solicitud está en trámite. También se le recordó que esté atento a cualquier notificación adicional por parte de USCIS, en particular sobre la programación de la cita para la toma de datos biométricos.\r\n\r\nContinuaré monitoreando el caso y proporcionaré actualizaciones tan pronto como se reciba nueva información. El cliente se encuentra bien informado y está preparado para asistir a la cita de datos biométricos cuando sea necesario.', '2024-08-02 12:51:47'),
(22, 38, 53, 'Hoy contacté al cliente para confirmar que recibió la notificación de la cita biométrica, programada para el [Fecha de la Cita]. Le recordé la importancia de asistir puntualmente a la cita con la documentación requerida: la notificación de la cita, su pasaporte, y la Tarjeta Verde actual, incluso si está vencida o dañada.', '2024-08-02 12:52:19'),
(23, 38, 53, 'Además, revisé con el cliente los pasos a seguir después de la cita biométrica, explicándole que una vez completada, el siguiente paso es esperar la decisión final de USCIS. También le informé que podría tardar algunos meses más en recibir la nueva Tarjeta Verde, y que debe seguir usando su Tarjeta Verde actual junto con el NOA1 para probar su estatus mientras tanto.', '2024-08-02 12:52:29'),
(24, 38, 53, 'El cliente agradeció la información y se mostró tranquilo y preparado para la cita. Continuaré haciendo seguimiento después de la cita biométrica para asegurarme de que todo se haya desarrollado sin problemas.', '2024-08-02 12:52:38'),
(25, 41, 10, 'Se ha revisado la documentación inicial proporcionada por el cliente y todo parece estar en orden. Hemos enviado la solicitud N-400 al USCIS y hemos recibido la notificación de recibo. El cliente ha sido informado sobre los tiempos de procesamiento actuales. Se programó una reunión con el cliente la próxima semana para prepararse para la entrevista de naturalización.\r\n', '2024-08-02 21:01:33'),
(26, 41, 10, 'El cliente asistió a la entrevista de naturalización el día de hoy. La entrevista transcurrió sin problemas, y el cliente respondió correctamente a todas las preguntas del oficial de USCIS. Nos informaron que el caso está bajo revisión y que recibiremos la decisión final en las próximas semanas. Hemos instruido al cliente para que esté pendiente de cualquier notificación adicional.\r\n', '2024-08-02 21:01:40'),
(27, 41, 10, 'Hemos recibido la notificación de aprobación del USCIS. El cliente ha sido programado para la ceremonia de juramentación el próximo mes. Se le ha enviado un recordatorio sobre los documentos necesarios para la ceremonia, y se confirmó su asistencia. Se dará seguimiento después de la ceremonia para cerrar el caso.\r\n', '2024-08-02 21:01:46'),
(28, 44, 50, 'we going to request also a U- Visa cert and case to uscis, because they were not married, after conference with family law attorney we decide that she will request a declaration of divorce under texas family law and also use it for the VAWA application ', '2024-08-14 03:09:29'),
(29, 44, 41, 'THE U VISA WILL BE PRO BONO BY VF', '2024-08-14 03:16:16'),
(30, 45, 50, 'voy a facilitarle mi email a clienta para que me envíen los resultados del FBI para pedir el PD ', '2024-08-14 03:40:19'),
