(33, 50, 29, 'Atty verbally told me to open k for $1500', '2024-08-20 23:24:06'),
(34, 52, 50, 'Si cliente no trae FOIA dependera de el si quiere proceder con el PIP o esperar el resultado de FOIA', '2024-08-21 02:30:54'),
(35, 52, 50, 'Client may not apply for AOS but he will be able to qualify for EAD, price of PIP 2024 will be 3500 ', '2024-08-21 04:27:44'),
(36, 62, 50, 'client wish to personally visit Houston office ', '2024-08-31 01:32:20'),
