(38, 80, 49, 'JORGE WILL BE SPEAKING WITH THE CLIENT', '2024-09-12 22:15:03'),
(39, 80, 61, ' Consulte con Raquel. En este caso la Sra. ya tiene la revision con el juez el día 16 de septiembre a las 8:00 am. La hija me indica que su madre le indico que recibió una charla en el centro de detención y allí le indicaron que no era necesario contratar abogados. Raquel me indica que al momento de la revision el juez solo nos permite emitir una declaración final. Que la cliente si en realidad pasa esa entrevista nos llame y la representamos.\r\nHablé con la hija de la cliente(Shirly) y le explique el proceso y le deje saber que tenía que decirle a su madre que en realidad existe un miedo real de regresar a su país. Le explique que si ella pasa la entrevista si nos puede llamar y nosotros llevaríamos su caso. ', '2024-09-12 23:07:42'),
(40, 82, 50, 'enviar la aplicación de cambio de corte después de los 180 días, debe haber enviado la aplicación de asilo antes de 1 de octubre de 2024 ', '2024-09-17 23:01:42'),
